import React from "react";
import Typewriter from "typewriter-effect/dist/core";

const typewritescript = () => {
  new Typewriter("#typewriter", {
    strings: [
      "wlc to my site",
      "a shope market",
      "fast send market",
      "connoisseur site",
    ],
    autoStart: true,
    loop: true,
    delay: 150,
    cursor: "|",
  });
  return <div id="typewriter"></div>;
};

export default typewritescript;
